import { HashRouter,  Route, Switch } from 'react-router-dom';
import './App.css';

import firebaseManger from "./utils/base";
import { AuthProvider } from "./utils/Auth";

import LandingPage from "./LandingPage";
import LoginPage from './LoginPage';
import ShoppingPage from './pages/shopping_list/ShoppingPage'
import SignUpPage from './SignUpPage';


function App() {
  return (
    <AuthProvider className="App">
      <HashRouter>
        <Switch>
          {firebaseManger.auth().currentUser ?   <Route exact path="/shopping_page" component={ShoppingPage} />:<Route exact path="/login" component={LoginPage}></Route>}

        </Switch>
      </HashRouter>

    </AuthProvider>

  );
}

export default App;
